import Head from 'next/head'

import Center from '../utils/center'
import Colors from '../constants/colors'

import styled from 'styled-components'
import Layout from './components/layout'

export default function Blog() {
  return (
    <Layout>
      <Head>
        <title>Privacy</title>
        <link rel="icon" href="/h.png" />
      </Head>

        <FindMeWrapper>Privacy Policy</FindMeWrapper>
    
    </Layout>
  )
}

const FindMeWrapper = styled.div`
  display: flex;
  width: 900px;
  height: 720px;
  background-color: grey;
  flex-direction: column;
  align
  margin-top: 64px;
  margin-left: 64px;
  margin-right: 64px;
  margin-bottom: 128px;
  border-radius: 8px;
  overflow: hidden;
  box-shadow: 1px 1px 1em 1px ${Colors.fmBlueExtraTransparent};
  transition: box-shadow 1s;

  &:hover {
    box-shadow: 1px 1px 1em 1px ${Colors.fmBlueTransparent};
  }
`
